import React from 'react'
import CardList from './CardList';
import {robots} from './robots';

const App = () => {
  return (
  <Card
    key={i}
    id={robots[i].id}
    name={robots[i].name}
    email={robots[i].email}
    />
    );
}
 
export default App;
